            <div class="news-details_content_title">
                <h2>تكريم أبو ذياب من قِبل صاحب السمو الملكي الأمير عبدالعزيز لرعايتنا الذهبية لـبطولة #رالي_حائل_تويوتا_الدولي_2020</h2>
            </div>
            <div class="news-details_content_describe">
                <div>الجمعة, 18 ديسمبر, 2020</div>
                <p>أعلنت شركة الوفاق لتأجير السيارات "أبو ذياب" في وقت سابق عن دخولها راعياً ذهبياً لرالي حائل تويوتا الدولي 2020، الذي يشكّل الجولتين الرابعة والخامسة من كأس العالم (باها كروس كاونتري)، وتُعد هذه الرعاية هي تأكيد على نهج الشركة في رعاية ودعم كافة الأنشطة الهادفة والتي تنعكس على الوطن وشبابه بالفائدة والنفع. وقد قام صاحب السمو الملكي الأمير عبدالعزيز بن سعد بن عبدالعزيز بتكريم أبو ذياب كونها الراعي الذهبي لـ "بطولة رالي حائل"، ويأتي هذا التكريم كدافع أكبر للشركة لتحقيق المزيد من المساهمات في مجال رعاية الأنشطة الهادفة بما يتماشى مع رؤية الخير والعطاء 2030. هذا والجدير بالذكر أن أبو ذياب تمتلك حضور مميز في رعاية عدد كبير من الأندية الرياضية محلياً وخارجياً وعدد من البطولات الرياضية في مختلف الألعاب، حيث أن الشركة هي الراعي الرسمي لأندية الرائد، الاتحاد، الفيصلي، وأبها، والباطن إلى جانب رعاية فرق أندية شيفيلد يونايتد الإنجليزي، وبرشكوت البلجيكي، والهلال يونايتد الإماراتي.</p>
            </div>
